import React from 'react';
import './Features.css'
import { Container, Row, Col, Image } from 'react-bootstrap';
import featuresImage from '../../assets/img/featuresImage.png'

export default function  Features() {
  return (
    <Container>
      <Row>
        <Col>
        <Image src={featuresImage} />
        </Col>
        <Col>
        </Col>
      </Row>
    </Container>
  );
}
